import React from 'react';
import {Card} from 'antd';

const {Meta} = Card;

const AdminProductCard = ({product}) => {
    // destructure
    const {title, description, images} = product;
    return (
        <Card 
        >
        <Meta title={title} description={description} />
        </Card>
    )
}
export default AdminProductCard;
